import { createIcon } from "../icon/createIcon";

export const ListIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ListIcon">
    <path d="M4 1h8v2H4V1zm0 4h8v2H4V5zm0 4h8v2H4V9zM0 1h2v2H0V1zm0 4h2v2H0V5zm0 4h2v2H0V9z" />
  </svg>,
  "List",
  "list"
);
